define('text!views/account-settings.html',[],function () { return '<div class="page-header">\r\n    <h2>Account Settings</h2>\r\n</div>\r\n\r\n<div id="leave-house-btn" class="col-md-9 row">\r\n    <button data-toggle="modal" data-target="#leave-house-modal" class="btn btn-danger">\r\n        <span class="glyphicon glyphicon-remove"></span>\r\n        <span>Leave House</span>\r\n    </button>\r\n</div>\r\n\r\n<div class="well col-md-4 module-panel house-settings-panel">\r\n    <table>\r\n        <tbody>\r\n            <tr>\r\n                <td>\r\n                    <label>House Name:</label></td>\r\n                <td>\r\n                    <input data-bind="value: houseName, valueUpdate: \'afterkeydown\'" type="text" class="form-control" /></td>\r\n            </tr>\r\n\r\n            <tr>\r\n                <td>\r\n                    <label>House Code:</label></td>\r\n                <td>\r\n                    <input data-bind="value: houseCode, valueUpdate: \'afterkeydown\'" type="text" class="form-control" /></td>\r\n            </tr>\r\n\r\n            <tr>\r\n                <td></td>\r\n                <td>\r\n                    <button data-bind="click: saveHousePanelClicked, enable: hasHouseChanged" class="btn btn-success">\r\n                        <span class="glyphicon glyphicon-floppy-disk"></span>Save\r\n                    </button>\r\n                    <button data-bind="click: undoHousePanelClicked, enable: hasHouseChanged" class="btn btn-primary">\r\n                        <span class="glyphicon glyphicon-repeat rotate-90"></span>Undo\r\n                    </button>\r\n                </td>\r\n            </tr>\r\n        </tbody>\r\n    </table>\r\n\r\n</div>\r\n\r\n<div class="col-md-1"></div>\r\n\r\n<div class="well col-md-4 module-panel house-settings-panel">\r\n    <form id="notification-row" class="form-inline" role="form">\r\n        <label>Email Notifications:</label>\r\n        <input id="email-notification-chkbox" type="checkbox" data-bind="checked: emailNotifications" />\r\n    </form>\r\n\r\n    <label>Display Picture:</label>\r\n\r\n    <br />\r\n\r\n    <img id="profile-pic-select" class="img-circle" data-bind="attr: { src: displayPictureURL }">\r\n\r\n    <button data-toggle="modal" data-target="#fb-pic-modal" class="btn btn-primary">Facebook</button>\r\n    <button data-toggle="modal" data-target="#file-pic-modal" class="btn btn-primary">File</button>\r\n    <button data-toggle="modal" data-target="#url-pic-modal" class="btn btn-primary">URL</button>\r\n</div>\r\n\r\n<div id="info-panel" class="well col-md-4 module-panel house-settings-panel">\r\n    <table>\r\n        <tbody>\r\n            <tr>\r\n                <td>\r\n                    <label>Full Name:</label></td>\r\n                <td>\r\n                    <input data-bind="value: fullName, valueUpdate: \'afterkeydown\'" type="text" class="form-control" /></td>\r\n            </tr>\r\n\r\n            <tr>\r\n                <td>\r\n                    <label>Email:</label></td>\r\n                <td>\r\n                    <input data-bind="value: email, valueUpdate: \'afterkeydown\'" type="text" class="form-control" /></td>\r\n            </tr>\r\n\r\n            <tr>\r\n                <td>\r\n                    <label>Password:</label></td>\r\n                <td>\r\n                    <input data-bind="value: password1, valueUpdate: \'afterkeydown\'" type="password" class="form-control" /></td>\r\n            </tr>\r\n\r\n            <tr>\r\n                <td>\r\n                    <label>Retype Password:</label></td>\r\n                <td>\r\n                    <input data-bind="value: password2, valueUpdate: \'afterkeydown\'" type="password" class="form-control" /></td>\r\n            </tr>\r\n\r\n            <tr>\r\n                <td></td>\r\n                <td>\r\n                    <button data-bind="click: saveUserInfoClicked, enable: hasUserInfoChanged" class="btn btn-success">\r\n                        <span class="glyphicon glyphicon-floppy-disk"></span>\r\n                        <span>Save</span>\r\n                    </button>\r\n                    <button data-bind="click: undoUserInfoClicked, enable: hasUserInfoChanged" class="btn btn-primary">\r\n                        <span class="glyphicon glyphicon-repeat"></span>\r\n                        <span>Undo</span>\r\n                    </button>\r\n                </td>\r\n            </tr>\r\n        </tbody>\r\n    </table>\r\n</div>\r\n\r\n<div class="col-md-1"></div>\r\n\r\n<div id="tenants-panel" class="well col-md-4 module-panel house-settings-panel">\r\n\r\n    <h4 class="panel-header">Pending Requests</h4>\r\n\r\n    <table class="tenants-table">\r\n        <tbody data-bind="foreach: pendingRequests">\r\n            <tr>\r\n                <td>\r\n                    <button data-bind="click: $root.acceptTenant" class="btn btn-xs btn-success">\r\n                        <span class="glyphicon glyphicon-ok"></span>\r\n                    </button>\r\n                    <button data-bind="click: $root.rejectTenant" class="btn btn-xs btn-danger">\r\n                        <span class="glyphicon glyphicon-remove"></span>\r\n                    </button>\r\n                </td>\r\n                <td>\r\n                    <label data-bind="text: User().FullName()"></label>\r\n                </td>\r\n            </tr>\r\n        </tbody>\r\n    </table>\r\n\r\n    <h4 id="tenants-heading">Tenants</h4>\r\n\r\n    <table class="tenants-table existing">\r\n        <tbody data-bind="foreach: tenants">\r\n            <tr>\r\n                <td>\r\n                    <button data-bind="click: $root.markDeleteTenant" data-toggle="modal" data-target="#delete-tenant-modal" class="btn btn-xs btn-danger">\r\n                        <span class="glyphicon glyphicon-remove"></span>\r\n                    </button>\r\n                </td>\r\n                <td>\r\n                    <label data-bind="text: FullName"></label>\r\n                </td>\r\n            </tr>\r\n        </tbody>\r\n    </table>\r\n</div>\r\n\r\n<!-- Delete Tenant Modal -->\r\n<div id="delete-tenant-modal" class="modal fade bs-example-modal-sm" tabindex="-1" role="dialog" aria-labelledby="mySmallModalLabel" aria-hidden="true">\r\n    <div class="modal-dialog modal-sm">\r\n        <div class="modal-content">\r\n            <div class="modal-header">\r\n                <button type="button" class="close" data-dismiss="modal" aria-hidden="true">&times;</button>\r\n                <h4 class="modal-title" id="myModalLabel">Delete Tenant Confirmation</h4>\r\n            </div>\r\n            <div class="modal-body">\r\n                <p>Are you sure you want to delete this tenant?</p>\r\n            </div>\r\n            <div class="modal-footer">\r\n                <button type="button" class="btn btn-default" data-dismiss="modal">No</button>\r\n                <button data-bind="click: deleteTenant" type="button" class="btn btn-primary" data-dismiss="modal">Yes</button>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</div>\r\n\r\n<!-- Facebook Profile Picture Modal -->\r\n<div id="fb-pic-modal" class="modal fade bs-example-modal-sm" tabindex="-1" role="dialog" aria-labelledby="mySmallModalLabel" aria-hidden="true">\r\n    <div class="modal-dialog">\r\n        <div class="modal-content">\r\n            <div class="modal-header">\r\n                <button type="button" class="close" data-dismiss="modal" aria-hidden="true">&times;</button>\r\n                <h4 class="modal-title" id="H1">Profile Picture From Facebook</h4>\r\n            </div>\r\n\r\n            <div class="modal-body">\r\n                <p>Enter your Facebook username or user ID.</p>\r\n\r\n                <br />\r\n\r\n                <form class="form-horizontal" role="form">\r\n                    <div class="form-group">\r\n                        <label for="inputFacebookPicture" class="col-sm-2 control-label">Username/ID</label>\r\n                        <div class="col-sm-10">\r\n                            <input type="text" class="form-control" id="inputFacebookPicture" placeholder="E.g. bill.stephens">\r\n                        </div>\r\n                    </div>\r\n                </form>\r\n            </div>\r\n\r\n            <div class="modal-footer">\r\n                <button type="button" class="btn btn-default" data-dismiss="modal">Close</button>\r\n                <button data-bind="click: pictureUploaded" type="button" class="btn btn-primary" data-dismiss="modal">Upload</button>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</div>\r\n\r\n<!-- File Profile Picture Modal -->\r\n<div id="file-pic-modal" class="modal fade bs-example-modal-sm" tabindex="-1" role="dialog" aria-labelledby="mySmallModalLabel" aria-hidden="true">\r\n    <div class="modal-dialog">\r\n        <div class="modal-content">\r\n            <div class="modal-header">\r\n                <button type="button" class="close" data-dismiss="modal" aria-hidden="true">&times;</button>\r\n                <h4 class="modal-title" id="H2">Profile Picture From File System </h4>\r\n            </div>\r\n            <div class="modal-body">\r\n\r\n                <p>\r\n                    Choose an image from your file system as your profile picture.\r\n                </p>\r\n\r\n                <br />\r\n\r\n                <form role="form">\r\n                    <div class="form-group">\r\n                        <label for="exampleInputFile">File Browser</label>\r\n                        <input type="file" id="exampleInputFile">\r\n                    </div>\r\n                </form>\r\n            </div>\r\n\r\n            <div class="modal-footer">\r\n                <button type="button" class="btn btn-default" data-dismiss="modal">Close</button>\r\n                <button data-bind="click: pictureUploaded" type="button" class="btn btn-primary" data-dismiss="modal">Upload</button>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</div>\r\n\r\n<!-- URL Profile Picture Modal -->\r\n<div id="url-pic-modal" class="modal fade bs-example-modal-sm" tabindex="-1" role="dialog" aria-labelledby="mySmallModalLabel" aria-hidden="true">\r\n    <div class="modal-dialog">\r\n        <div class="modal-content">\r\n\r\n            <div class="modal-header">\r\n                <button type="button" class="close" data-dismiss="modal" aria-hidden="true">&times;</button>\r\n                <h4 class="modal-title" id="H3">Profile Picture From URL</h4>\r\n            </div>\r\n\r\n            <div class="modal-body">\r\n                <p>Enter the URL of your profile picture.</p>\r\n\r\n                <br />\r\n\r\n                <form class="form-horizontal" role="form">\r\n                    <div class="form-group">\r\n                        <label for="inputURLPicture" class="col-sm-1 control-label">URL</label>\r\n                        <div class="col-sm-11">\r\n                            <input type="text" class="form-control" id="inputURLPicture" placeholder="E.g. http://www.somewebsite/picture.jpg">\r\n                        </div>\r\n                    </div>\r\n                </form>\r\n            </div>\r\n\r\n            <div class="modal-footer">\r\n                <button type="button" class="btn btn-default" data-dismiss="modal">Close</button>\r\n                <button data-bind="click: pictureUploaded" type="button" class="btn btn-primary" data-dismiss="modal">Upload</button>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</div>\r\n\r\n<!-- Leave House Modal -->\r\n<div id="leave-house-modal" class="modal fade bs-example-modal-sm" tabindex="-1" role="dialog" aria-labelledby="mySmallModalLabel" aria-hidden="true">\r\n    <div class="modal-dialog modal-sm">\r\n        <div class="modal-content">\r\n\r\n            <div class="modal-header">\r\n                <button type="button" class="close" data-dismiss="modal" aria-hidden="true">&times;</button>\r\n                <h4 class="modal-title" id="H4">Leave House Confirmation</h4>\r\n            </div>\r\n\r\n            <div class="modal-body">\r\n                <p>Are you sure you want to leave the house?</p>\r\n            </div>\r\n\r\n            <div class="modal-footer">\r\n                <button type="button" class="btn btn-default" data-dismiss="modal">No</button>\r\n                <button data-bind="click: leaveHouseConfirmed" type="button" class="btn btn-primary" data-dismiss="modal">Yes</button>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</div>\r\n';});


define('text!views/add-bill-invoice.html',[],function () { return '<div class="page-header">\r\n    <h2>Bill Invoice</h2>\r\n</div>\r\n\r\n<div id="invoice-settings-panel" class="well col-md-5 module-panel">\r\n\r\n    <table>\r\n        <tr>\r\n            <td id="invoice-name-row" colspan="3">\r\n                <h3 data-bind="text: billName"></h3>\r\n            </td>\r\n        </tr>\r\n\r\n        <tbody data-bind="foreach: invoiceRecipients()">\r\n\r\n            <tr class="invoice-tenant-row">\r\n                <td class="invoice-paid-cell">\r\n                    <button data-bind="click: $root.checkboxClicked" type="button" class="btn btn-default btn-paid">\r\n                        <span data-bind="attr: { class: GlyphClass }"></span>\r\n                    </button>\r\n                </td>\r\n\r\n                <td class="invoice-recip">\r\n                    <!-- Split button -->\r\n                    <div class="btn-group form-group">\r\n                        <button data-bind="text: UserFullName" type="button" class="btn btn-default dropdown-button"></button>\r\n                        <button type="button" class="btn btn-default dropdown-toggle" data-toggle="dropdown">\r\n                            <span class="caret"></span>\r\n                            <span class="sr-only">Toggle Dropdown</span>\r\n                        </button>\r\n                        <ul data-bind="foreach: $root.tenantsList()" class="dropdown-menu" role="menu">\r\n                            <li><a data-bind="text: UserFullName, click: function (data, event) { $root.clickedCombo(UserFullName, $parentContext.$data) }"></a></li>\r\n                        </ul>\r\n                    </div>\r\n                </td>\r\n\r\n                <td class="invoice-value">\r\n                    <div class="form-group">\r\n                        <div class="input-group">\r\n                            <span class="input-group-addon">&pound;</span>\r\n                            <input data-bind="value: Amount, valueUpdate: \'afterkeydown\'" type="text" class="form-control" placeholder="e.g. 30" />\r\n                        </div>\r\n                    </div>\r\n                </td>\r\n\r\n                <td class="cell-add-btn">\r\n                    <button data-bind="click: $root.removeRecipient" type="button" class="btn btn-danger">\r\n                        <span class="glyphicon glyphicon-remove"></span>\r\n                    </button>\r\n                </td>\r\n\r\n            </tr>\r\n        </tbody>\r\n    </table>\r\n\r\n    <hr class="nav-seperator" />\r\n    \r\n    <table>\r\n        <tbody data-bind="with: newInvoiceRecipient()">\r\n            <tr class="invoice-tenant-row">\r\n                <td class="invoice-paid-cell">\r\n                    <button data-bind="click: $root.checkboxClicked" type="button" class="btn btn-default btn-paid">\r\n                        <span data-bind="attr: { class: GlyphClass() }"></span>\r\n                    </button>\r\n                </td>\r\n\r\n                <td class="invoice-recip">\r\n                    <!-- Split button -->\r\n                    <div class="btn-group form-group">\r\n                        <button data-bind="text: UserFullName()" type="button" class="btn btn-default dropdown-button">Select a recipient</button>\r\n                        <button type="button" class="btn btn-default dropdown-toggle" data-toggle="dropdown">\r\n                            <span class="caret"></span>\r\n                            <span class="sr-only">Toggle Dropdown</span>\r\n                        </button>\r\n                        <ul data-bind="foreach: $root.tenantsList()" class="dropdown-menu" role="menu">\r\n                            <li><a data-bind="text: UserFullName, click: function (data, event) { $root.clickedCombo(UserFullName, $parentContext.$data) }"></a></li>\r\n                        </ul>\r\n                    </div>\r\n                </td>\r\n\r\n                <td class="invoice-value">\r\n                    <div class="form-group">\r\n                        <div class="input-group">\r\n                            <span class="input-group-addon">&pound;</span>\r\n                            <input data-bind="value: Amount" type="text" class="form-control" placeholder="e.g. 30">\r\n                        </div>\r\n                    </div>\r\n                </td>\r\n\r\n                <td class="cell-add-btn">\r\n                    <button data-bind="click: $root.addNewRecipient" type="button" class="btn btn-success">\r\n                        <span class="glyphicon glyphicon-plus"></span>\r\n                    </button>\r\n                </td>\r\n            </tr>\r\n        </tbody>\r\n    </table>\r\n\r\n\r\n    <form class="form-inline" role="form">\r\n        <table>\r\n            <tbody>\r\n                <tr>\r\n                    <td>\r\n                        <label id="total-label">Total Amount:</label>\r\n                    </td>\r\n                    <td>\r\n                        <div class="form-group invoice-value">\r\n                            <div class="input-group">\r\n                                <span class="input-group-addon">&pound;</span>\r\n                                <input data-bind="value: totalAmount, valueUpdate: \'afterkeydown\'" type="text" class="form-control" placeholder="e.g. 30">\r\n                            </div>\r\n                        </div>\r\n                    </td>\r\n                </tr>\r\n\r\n                <tr>\r\n                    <td>\r\n                        <label id="total-label">Due Date:</label>\r\n                    </td>\r\n\r\n                    <td>\r\n                        <div class="form-group">\r\n                            <div class="input-group date" data-date-format="d MM \'yy">\r\n                                <input data-bind="value: dueDate" type="text" class="form-control" placeholder="Select a date" />\r\n                                <span class="input-group-addon"><span class="glyphicon glyphicon-calendar"></span></span>\r\n                            </div>\r\n                        </div>\r\n                    </td>\r\n                </tr>\r\n            </tbody>\r\n        </table>\r\n    </form>\r\n\r\n    <div id="invoice-btn-bar">\r\n        <button data-bind="click: invoiceCreated" type="Save" class="btn btn-success">\r\n            <span class="glyphicon glyphicon-floppy-disk"></span>Create\r\n        </button>\r\n\r\n        <button data-bind="click: invoiceUndone" type="Save" class="btn btn-primary">\r\n            <span class="glyphicon glyphicon-repeat rotate-90"></span>Undo\r\n        </button>\r\n    </div>\r\n\r\n</div>\r\n';});


define('text!views/bills.html',[],function () { return '<div class="page-header">\r\n    <h2>Bills</h2>\r\n</div>\r\n\r\n<button data-toggle="modal" data-target="#add-bill-modal" id="add-bill-btn" type="button" class="btn btn-primary">\r\n    <span class="glyphicon glyphicon-plus"></span>Add Bill\r\n</button>\r\n\r\n<div data-bind="foreach: bills">\r\n\r\n    <div class="well col-md-5 module-panel bill-panel">\r\n\r\n        <img class="img-circle bill-manager-pic" data-bind="attr: { src: ProfilePicture }">\r\n\r\n        <h3 data-bind="text: Name"></h3>\r\n\r\n\r\n        <button data-bind="click: $root.markBillForDelete" data-toggle="modal" data-target=".bs-modal-sm" type="button" class="close" aria-hidden="true">&times;</button>\r\n\r\n        <p class="invoice-ctrls">\r\n            <button data-bind="click: $root.navToAddInvoice" type="button" class="btn btn-primary btn-xs btn-add">\r\n                <span class="glyphicon glyphicon-plus"></span>Add\r\n            </button>\r\n            <button data-bind="click: $root.navToEditInvoice" type="button" class="btn btn-primary btn-xs btn-edit">\r\n                <span class="glyphicon glyphicon-cog"></span>Edit\r\n            </button>\r\n        </p>\r\n\r\n        <h4 data-bind="if: Invoices().length == 0">No Invoices To Display</h4>\r\n\r\n        <table data-bind="if: Invoices().length > 0" class="panel-table">\r\n            <tbody data-bind="foreach: Invoices()[InvoiceIndex()].Recipients()">\r\n                <tr>\r\n                    <td>\r\n                        <button data-bind="click: $root.checkboxClicked" type="button" class="btn btn-default btn-xs btn-paid">\r\n                            <span data-bind="attr: { class: GlyphClass }"></span>\r\n                        </button>\r\n                    </td>\r\n                    <td data-bind="text: UserFullName">Adam Barrell</td>\r\n                    <td data-bind="text: Amount">&pound;30</td>\r\n                </tr>\r\n            </tbody>\r\n        </table>\r\n\r\n        <div data-bind="if: Invoices().length > 0" class="module-nav-panel">\r\n            <button data-bind="click: $root.navPreviousInvoice, enable: $root.isPreviousEnabled(InvoiceIndex(), Invoices().length)" type="button" class="btn btn-default btn-sm">\r\n                <span class="glyphicon glyphicon-chevron-left"></span>\r\n            </button>\r\n\r\n            <span><strong data-bind="text: Invoices()[InvoiceIndex()].DueDate" class="text-info"></strong></span>\r\n\r\n            <button data-bind="click: $root.navNextInvoice, enable: $root.isNextEnabled(InvoiceIndex(), Invoices().length)" type="button" class="btn btn-default btn-sm">\r\n                <span class="glyphicon glyphicon-chevron-right"></span>\r\n            </button>\r\n        </div>\r\n\r\n    </div>\r\n\r\n    <div class="col-md-1 module-spacer"></div>\r\n\r\n</div>\r\n\r\n<!-- Delete bill modal -->\r\n\r\n<div class="modal fade bs-modal-sm" tabindex="-1" role="dialog" aria-labelledby="mySmallModalLabel" aria-hidden="true">\r\n    <div class="modal-dialog modal-sm">\r\n        <div class="modal-content">\r\n            <div class="modal-header">\r\n                <button type="button" class="close" data-dismiss="modal" aria-hidden="true">&times;</button>\r\n                <h4 class="modal-title" id="myModalLabel">Delete Bill Type</h4>\r\n            </div>\r\n            <div class="modal-body">\r\n                Are you sure you want to delete this bill type and all of its associated invoices?\r\n            </div>\r\n            <div class="modal-footer">\r\n                <button data-bind="click: deleteBill" type="button" class="btn btn-success" data-dismiss="modal">Yes</button>\r\n                <button type="button" class="btn btn-default" data-dismiss="modal">Close</button>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</div>\r\n\r\n<!-- Add bill modal -->\r\n<div class="modal fade" id="add-bill-modal" tabindex="-1" role="dialog" aria-labelledby="registrationModalLabel" aria-hidden="true">\r\n    <div class="modal-dialog modal-sm">\r\n        <div class="modal-content">\r\n            <div class="modal-header">\r\n                <button type="button" class="close" data-dismiss="modal"\r\n                    aria-hidden="true">\r\n                    &times;\r\n                </button>\r\n                <h4 class="modal-title">Add a New Bill Type</h4>\r\n            </div>\r\n            <form data-bind="with: newBillType()" class="form-inline" role="form">\r\n                <div class="modal-body">\r\n                    <dl>\r\n                        <dt>\r\n                            <label>Bill Name</label>\r\n                        </dt>\r\n                        <dd>\r\n                            <input data-bind="value: Name" class="form-control" placeholder="Name of the new bill type">\r\n                        </dd>\r\n                    </dl>\r\n\r\n                    <dl>\r\n                        <dt>\r\n                            <label>Manager</label>\r\n                        </dt>\r\n                        <dd>\r\n                            <div class="btn-group form-group">\r\n                                <button data-bind="text: Manager" type="button" class="btn btn-default dropdown-button"></button>\r\n                                <button type="button" class="btn btn-default dropdown-toggle" data-toggle="dropdown">\r\n                                    <span class="caret"></span>\r\n                                    <span class="sr-only">Toggle Dropdown</span>\r\n                                </button>\r\n                                <ul data-bind="foreach: $root.tenantsList()" class="dropdown-menu" role="menu">\r\n                                    <li><a data-bind="text: UserFullName, click: function (data, event) { $root.clickedCombo(UserFullName, $parentContext.$data) }"></a></li>\r\n                                </ul>\r\n                            </div>\r\n                        </dd>\r\n                    </dl>\r\n                </div>\r\n\r\n                <div class="modal-footer">\r\n                    <button type="button" class="btn btn-default" data-dismiss="modal">\r\n                        Close\r\n                    </button>\r\n                    <button data-bind="click: $root.createdBillType" type="submit" class="btn btn-success" data-dismiss="modal">\r\n                        Create\r\n                    </button>\r\n                </div>\r\n            </form>\r\n        </div>\r\n    </div>\r\n</div>';});


define('text!views/details.html',[],function () { return '<section>\r\n    <h2 class="page-title" data-bind="text: title"></h2>\r\n</section>';});


define('text!views/edit-bill-invoice.html',[],function () { return '<div class="page-header">\r\n    <h2>Bill Invoice</h2>\r\n</div>\r\n\r\n<div id="invoice-settings-panel" class="well col-md-6 module-panel">\r\n\r\n    <table>\r\n        <tr>\r\n            <td id="invoice-name-row" colspan="3">\r\n                <h3 data-bind="text: billName"></h3>\r\n            </td>\r\n        </tr>\r\n\r\n        <tbody data-bind="foreach: invoiceRecipients()">\r\n\r\n            <tr class="invoice-tenant-row">\r\n                <td class="invoice-paid-cell">\r\n                    <button data-bind="click: $root.checkboxClicked" type="button" class="btn btn-default btn-paid">\r\n                        <span data-bind="attr: { class: GlyphClass }"></span>\r\n                    </button>\r\n                </td>\r\n\r\n                <td class="invoice-recip">\r\n                    <!-- Split button -->\r\n                    <div class="btn-group form-group">\r\n                        <button data-bind="text: UserFullName" type="button" class="btn btn-default dropdown-button"></button>\r\n                        <button type="button" class="btn btn-default dropdown-toggle" data-toggle="dropdown">\r\n                            <span class="caret"></span>\r\n                            <span class="sr-only">Toggle Dropdown</span>\r\n                        </button>\r\n                        <ul data-bind="foreach: $root.tenantsList()" class="dropdown-menu" role="menu">\r\n                            <li><a data-bind="text: UserFullName, click: function (data, event) { $root.clickedCombo(UserFullName, $parentContext.$data) }"></a></li>\r\n                        </ul>\r\n                    </div>\r\n                </td>\r\n\r\n                <td class="invoice-value">\r\n                    <div class="form-group">\r\n                        <div class="input-group">\r\n                            <span class="input-group-addon">&pound;</span>\r\n                            <input data-bind="value: Amount, valueUpdate: \'afterkeydown\'" type="text" class="form-control" placeholder="e.g. 30" />\r\n                        </div>\r\n                    </div>\r\n                </td>\r\n\r\n                <td class="cell-add-btn">\r\n                    <button data-bind="click: $root.removeRecipient" type="button" class="btn btn-danger">\r\n                        <span class="glyphicon glyphicon-remove"></span>\r\n                    </button>\r\n                </td>\r\n\r\n            </tr>\r\n        </tbody>\r\n    </table>\r\n\r\n    <hr class="nav-seperator" />\r\n\r\n    <table>\r\n        <tbody data-bind="with: newInvoiceRecipient()">\r\n            <tr class="invoice-tenant-row">\r\n                <td class="invoice-paid-cell">\r\n                    <button data-bind="click: $root.checkboxClicked" type="button" class="btn btn-default btn-paid">\r\n                        <span data-bind="attr: { class: GlyphClass() }"></span>\r\n                    </button>\r\n                </td>\r\n\r\n                <td class="invoice-recip">\r\n                    <!-- Split button -->\r\n                    <div class="btn-group form-group">\r\n                        <button data-bind="text: UserFullName()" type="button" class="btn btn-default dropdown-button">Select a recipient</button>\r\n                        <button type="button" class="btn btn-default dropdown-toggle" data-toggle="dropdown">\r\n                            <span class="caret"></span>\r\n                            <span class="sr-only">Toggle Dropdown</span>\r\n                        </button>\r\n                        <ul data-bind="foreach: $root.tenantsList()" class="dropdown-menu" role="menu">\r\n                            <li><a data-bind="text: UserFullName, click: function (data, event) { $root.clickedCombo(UserFullName, $parentContext.$data) }"></a></li>\r\n                        </ul>\r\n                    </div>\r\n                </td>\r\n\r\n                <td class="invoice-value">\r\n                    <div class="form-group">\r\n                        <div class="input-group">\r\n                            <span class="input-group-addon">&pound;</span>\r\n                            <input data-bind="value: Amount" type="text" class="form-control" placeholder="e.g. 30">\r\n                        </div>\r\n                    </div>\r\n                </td>\r\n\r\n                <td class="cell-add-btn">\r\n                    <button data-bind="click: $root.addNewRecipient" type="button" class="btn btn-success">\r\n                        <span class="glyphicon glyphicon-plus"></span>\r\n                    </button>\r\n                </td>\r\n            </tr>\r\n        </tbody>\r\n    </table>\r\n\r\n\r\n    <form class="form-inline" role="form">\r\n        <table>\r\n            <tbody>\r\n                <tr>\r\n                    <td>\r\n                        <label id="total-label">Total Amount:</label>\r\n                    </td>\r\n                    <td>\r\n                        <div class="form-group invoice-value">\r\n                            <div class="input-group">\r\n                                <span class="input-group-addon">&pound;</span>\r\n                                <input data-bind="value: totalAmount, valueUpdate: \'afterkeydown\'" type="text" class="form-control" placeholder="e.g. 30">\r\n                            </div>\r\n                        </div>\r\n                    </td>\r\n                </tr>\r\n\r\n                <tr>\r\n                    <td>\r\n                        <label id="Label1">Due Date:</label>\r\n                    </td>\r\n\r\n                    <td>\r\n                        <div class="form-group">\r\n                            <div class="input-group date" data-date-format="d MM \'yy">\r\n                                <input data-bind="value: dueDate" type="text" class="form-control" placeholder="Select a date" />\r\n                                <span class="input-group-addon"><span class="glyphicon glyphicon-calendar"></span></span>\r\n                            </div>\r\n                        </div>\r\n                    </td>\r\n                </tr>\r\n            </tbody>\r\n        </table>\r\n    </form>\r\n\r\n    <div id="invoice-btn-bar">\r\n        <button data-bind="click: invoiceSaved" type="Save" class="btn btn-success">\r\n            <span class="glyphicon glyphicon-floppy-disk"></span>Save\r\n        </button>\r\n\r\n        <button data-bind="click: invoiceUndone" class="btn btn-primary">\r\n            <span class="glyphicon glyphicon-repeat rotate-90"></span>Undo\r\n        </button>\r\n        <button data-bind="click: invoiceDeleted" class="btn btn-danger">\r\n            <span class="glyphicon glyphicon-remove"></span>Delete\r\n        </button>\r\n    </div>\r\n\r\n</div>\r\n';});


define('text!views/edit-bin-rota.html',[],function () { return '<div class="page-header">\r\n    <h2>Bin Rota Settings</h2>\r\n</div>\r\n\r\n<div id="bin-types-panel" class="well col-md-12 module-panel">\r\n\r\n    <h3 class="panel-header">Bin Types</h3>\r\n\r\n    <table class="panel-table">\r\n\r\n        <tbody>\r\n            <!-- ko foreach: binTypes() -->\r\n            <tr>\r\n                <td>\r\n                    <input data-bind="value: Name()" type="text" class="form-control input-bin-name"></td>\r\n\r\n                <td>\r\n                    <div class="btn-group occurance-options">\r\n                        <button data-bind="text: Occurance()" type="button" class="btn btn-default"></button>\r\n                        <button type="button" class="btn btn-default dropdown-toggle" data-toggle="dropdown">\r\n                            <span class="caret"></span>\r\n                            <span class="sr-only">Toggle Dropdown</span>\r\n                        </button>\r\n                        <ul data-bind="foreach: $root.occuranceOptions()" class="dropdown-menu" role="menu">\r\n                            <li><a data-bind="text: Name, click: function (data, event) { $root.occuranceOptionsClicked($parentContext.$data, Name, data, event) }"></a></li>\r\n                        </ul>\r\n                    </div>\r\n                </td>\r\n\r\n                <td>\r\n\r\n                    <div class="form-group">\r\n                        <div class="input-group date" data-date-format="d MM \'yy">\r\n                            <input data-bind="value: StartDate()" type="text" class="form-control input-bin-date" placeholder="Select a date" />\r\n                            <span class="input-group-addon"><span class="glyphicon glyphicon-calendar"></span></span>\r\n                        </div>\r\n                    </div>\r\n                </td>\r\n\r\n                <td>\r\n\r\n                    <div class="btn-group">\r\n                        <button type="button" class="btn btn-default dropdown-toggle" data-toggle="dropdown">\r\n                            <span data-bind="css: Colour()" class="square-dropdown"></span><span class="caret"></span>\r\n                        </button>\r\n                        <ul data-bind="foreach: $root.binColourOptions()" class="dropdown-menu" role="menu">\r\n                            <li>\r\n                                <a data-bind="click: function (data, event) { $root.binColourOptionsClicked($parentContext.$data, Name, data, event) }">\r\n                                <span data-bind="css: Name" class="square-dropdown">&nbsp;</span>\r\n                            </a>\r\n                            </li>\r\n                        </ul>\r\n                    </div>\r\n\r\n                </td>\r\n                <td>\r\n                    <button data-bind="click: $root.deleteBinTypeClicked" type="button" class="btn btn-danger">\r\n                        <span class="glyphicon glyphicon-remove"></span>\r\n                    </button>\r\n                </td>\r\n            </tr>\r\n            <!-- /ko -->\r\n\r\n            <!-- ko with: newBinType() -->\r\n            <tr class="new-bin-type-row">\r\n                <td>\r\n                    <input data-bind="value: Name" type="text" class="form-control input-bin-name" placeholder="Bin name">\r\n                </td>\r\n\r\n                <td>\r\n                    <div class="btn-group occurance-options">\r\n                        <button data-bind="text: Occurance()" type="button" class="btn btn-default"></button>\r\n                        <button type="button" class="btn btn-default dropdown-toggle" data-toggle="dropdown">\r\n                            <span class="caret"></span>\r\n                            <span class="sr-only">Toggle Dropdown</span>\r\n                        </button>\r\n                        <ul data-bind="foreach: $root.occuranceOptions()" class="dropdown-menu" role="menu">\r\n                            <li><a data-bind="text: Name, click: function (data, event) { $root.occuranceOptionsClicked($parentContext.$data, Name, data, event) }"></a></li>\r\n                        </ul>\r\n                    </div>\r\n                </td>\r\n\r\n                <td>\r\n                    <div class="form-group">\r\n                        <div class="input-group date" data-date-format="d MM \'yy">\r\n                            <input data-bind="value: StartDate" type="text" class="form-control input-bin-date" placeholder="Select a date" />\r\n                            <span class="input-group-addon"><span class="glyphicon glyphicon-calendar"></span></span>\r\n                        </div>\r\n                    </div>\r\n                </td>\r\n\r\n                <td>\r\n\r\n\r\n                    <div class="btn-group">\r\n                        <button type="button" class="btn btn-default dropdown-toggle" data-toggle="dropdown">\r\n                            <span data-bind="css: Colour()" class="square-dropdown"></span><span class="caret"></span>\r\n                        </button>\r\n                        <ul data-bind="foreach: $root.binColourOptions()" class="dropdown-menu" role="menu">\r\n                            <li>\r\n                                <a data-bind="click: function (data, event) { $root.binColourOptionsClicked($parentContext.$data, Name, data, event) }">\r\n                                <span data-bind="css: Name" class="square-dropdown">&nbsp;</span>\r\n                            </a>\r\n                            </li>\r\n                        </ul>\r\n                    </div>\r\n                </td>\r\n                <td>\r\n                    <button data-bind="click: $root.addBinTypeClicked" type="button" class="btn btn-success">\r\n                        <span class="glyphicon glyphicon-plus"></span>\r\n                    </button>\r\n                </td>\r\n            </tr>\r\n            <!-- /ko -->\r\n        </tbody>\r\n    </table>\r\n\r\n    <form role="form">\r\n        <button data-bind="click: saveBinTypesClicked" type="Save" class="btn btn-primary">\r\n            <span class="glyphicon glyphicon-floppy-disk"></span>Save\r\n        </button>\r\n\r\n        <button data-bind="click: undoBinTypesClicked" type="Save" class="btn btn-primary">\r\n            <span class="glyphicon glyphicon-repeat rotate-90"></span>Undo\r\n        </button>\r\n    </form>\r\n\r\n</div>\r\n\r\n<div class="col-md-1 "></div>\r\n\r\n<div id="bin-groups-panel" class="well col-md-12 module-panel">\r\n\r\n    <h3 class="panel-header">Rota Groups</h3>\r\n\r\n    <table class="panel-table">\r\n        <tbody data-bind="foreach: tenantGroups()">\r\n            <tr>\r\n                <td data-bind="text: TenantName"></td>\r\n                <td>\r\n                    <div class="btn-group occurance-options">\r\n                        <button data-bind="text: Group()" type="button" class="btn btn-sm btn-default btn-group-num"></button>\r\n                        <button type="button" class="btn btn-sm btn-default dropdown-toggle" data-toggle="dropdown">\r\n                            <span class="caret"></span>\r\n                            <span class="sr-only">Toggle Dropdown</span>\r\n                        </button>\r\n                        <ul data-bind="foreach: $root.rotaGroups()" class="dropdown-menu" role="menu">\r\n                            <li><a data-bind="text: Name, click: function (data, event) { $root.groupOptionClicked($parentContext.$data, Name, data, event) }"></a></li>\r\n                        </ul>\r\n                    </div>\r\n                </td>\r\n            </tr>\r\n        </tbody>\r\n    </table>\r\n\r\n</div>\r\n';});


define('text!views/edit-cleaning-rota.html',[],function () { return '<div class="page-header">\r\n    <h2>Cleaning Rota Settings</h2>\r\n</div>\r\n\r\n<div id="areas-panel" class="well col-md-4 module-panel">\r\n\r\n    <h3 class="panel-header">Communal Areas</h3>\r\n\r\n    <form role="form">\r\n\r\n        <!-- ko foreach: communalAreas() -->\r\n        <div class="input-group">\r\n            <input data-bind="value: Name" type="text" class="form-control input-sm">\r\n            <span class="input-group-btn">\r\n                <button data-bind="click: $root.removeAreaClicked" type="button" class="btn btn-sm btn-danger">\r\n                    <span class="glyphicon glyphicon-remove"></span>\r\n                </button>\r\n            </span>\r\n        </div>\r\n        <!-- /ko -->\r\n\r\n        <div id="new-area-input" class="input-group">\r\n            <input data-bind="value: newCommunalArea" type="text" class="form-control input-sm" placeholder="Type a new area here...">\r\n            <span class="input-group-btn">\r\n                <button data-bind="click: $root.addAreaClicked" type="button" class="btn btn-sm btn-success">\r\n                    <span class="glyphicon glyphicon-plus"></span>\r\n                </button>\r\n            </span>\r\n        </div>\r\n\r\n        <button data-bind="click: saveAreasClicked" type="Save" class="btn btn-primary">\r\n            <span class="glyphicon glyphicon-floppy-disk"></span>Save\r\n        </button>\r\n\r\n        <button data-bind="click: undoAreasClicked" type="Save" class="btn btn-primary">\r\n            <span class="glyphicon glyphicon-repeat rotate-90"></span>Undo\r\n        </button>\r\n    </form>\r\n\r\n</div>\r\n\r\n<div class="col-md-1 module-spacer"></div>\r\n\r\n<div id="clean-groups-panel" class="well col-md-4 module-panel">\r\n\r\n    <h3 class="panel-header">Rota Groups</h3>\r\n\r\n    <table class="panel-table">\r\n        <tbody data-bind="foreach: tenantGroups()">\r\n            <tr>\r\n                <td data-bind="text: TenantName"></td>\r\n                <td>\r\n                    <div class="btn-group">\r\n                        <button data-bind="text: Group()" type="button" class="btn btn-sm btn-default btn-group-num"></button>\r\n                        <button type="button" class="btn btn-sm btn-default dropdown-toggle" data-toggle="dropdown">\r\n                            <span class="caret"></span>\r\n                            <span class="sr-only">Toggle Dropdown</span>\r\n                        </button>\r\n                        <ul data-bind="foreach: $root.rotaGroups()" class="dropdown-menu" role="menu">\r\n                            <li><a data-bind="text: Name, click: function (data, event) { $root.groupOptionClicked($parentContext.$data, Name, data, event) }"></a></li>\r\n                        </ul>\r\n                    </div>\r\n                </td>\r\n            </tr>\r\n        </tbody>\r\n    </table>\r\n\r\n</div>\r\n\r\n<div id="clean-date-panel" class=" well col-md-9 module-panel">\r\n    <h3 class="panel-header">Settings</h3>\r\n\r\n    <form class="row form-inline" role="form">\r\n\r\n\r\n        <div class="form-group col-sm-6 col-md-6">\r\n            <label>Start Date:</label>\r\n            <div class="input-group date" data-date-format="d MM \'yy">\r\n                <input data-bind="value: startDate" type="text" class="form-control" placeholder="Select a date" />\r\n                <span class="input-group-addon"><span class="glyphicon glyphicon-calendar"></span></span>\r\n            </div>\r\n        </div>\r\n\r\n\r\n        <div class="form-group col-sm-6 col-md-6">\r\n            <label>Occurance:</label>\r\n\r\n            <div class="input-group btn-group">\r\n                <button data-bind="text: rotaOccurance()" id="btn-clean-occurance" type="button" class="btn btn-sm btn-default"></button>\r\n                <button type="button" class="btn btn-sm btn-default dropdown-toggle" data-toggle="dropdown">\r\n                    <span class="caret"></span>\r\n                    <span class="sr-only">Toggle Dropdown</span>\r\n                </button>\r\n                <ul data-bind="foreach: occuranceOptions()" class="dropdown-menu" role="menu">\r\n                    <li><a data-bind="text: OptionName, click: function (data, event) { $root.occuranceOptionClicked(OptionName, data, event) }"></a></li>\r\n                </ul>\r\n            </div>\r\n        </div>\r\n    </form>\r\n\r\n    <div class="row col-md-12 cleaning-rota-action-panel">\r\n        <button data-bind="click: saveSettingsClicked" type="Save" class="btn btn-primary">\r\n            <span class="glyphicon glyphicon-floppy-disk"></span>Save\r\n        </button>\r\n\r\n        <button data-bind="click: undoSettingsClicked" type="Save" class="btn btn-primary">\r\n            <span class="glyphicon glyphicon-repeat rotate-90"></span>Undo\r\n        </button>\r\n    </div>\r\n\r\n</div>\r\n';});


define('text!views/footer.html',[],function () { return '<nav class="navbar navbar-fixed-bottom">\r\n    <div class="navbar-inner navbar-content-center">\r\n        <span class="pull-left"><a href="http://johnpapa.net/spa" target="_blank">Learn how to build a SPA </a></span>\r\n        <span class="pull-right"><a href="http://johnpapa.net/hottowel" target="_blank">Hot Towel SPA -  2013 JohnPapa.net</a></span>\r\n    </div>\r\n</nav>\r\n';});


define('text!views/home.html',[],function () { return '<div class="page-header">\r\n    <h2 data-bind="text: houseName()"></h2>\r\n</div>\r\n\r\n<div class="row">\r\n\r\n    <!-- ANNOUNCEMENTS PANEL -->\r\n    <div class="fader-container">\r\n        <div id="announcement-panel" class="col-md-5">\r\n\r\n            <h3 class="panel-heading">Announcements</h3>\r\n\r\n            <div class="input-group">\r\n                <input data-bind="value: messageInput, valueUpdate: \'afterkeypress\'" type="text" id="message-box" class="form-control" placeholder="Type your message here...">\r\n                <span class="input-group-btn">\r\n                    <button data-bind="click: addMessage" id="send-announce-btn" class="btn btn-success">\r\n                        <span class="glyphicon glyphicon-plus"></span>\r\n                    </button>\r\n                </span>\r\n            </div>\r\n\r\n            <div data-bind="foreach: messageFeed()">\r\n                <div class="well announce-box">\r\n                    <button data-bind="click: $root.deleteMessage" type="button" class="close" aria-hidden="true">&times;</button>\r\n                    <img data-bind="attr: { src: User().DisplayPictureFilePath() }" class="img-circle announce-picture" >\r\n                    <p data-bind="text: DisplayMessage()"></p>\r\n                    <p data-bind="text: TimeElapsed()" class="announce-date"></p>\r\n                </div>\r\n            </div>\r\n        </div>\r\n\r\n       <div class="div-fader"></div>\r\n    </div>\r\n\r\n    <!-- ACTIVITIES PANEL -->\r\n    <div class="fader-container">\r\n        <div id="activity-panel" class="col-md-5">\r\n\r\n            <h3 class="panel-heading">House Activity</h3>\r\n\r\n            <div data-bind="foreach: activityFeed">\r\n                <div class="well announce-box">\r\n                    <span data-bind="attr: { class: Icon() }"></span>\r\n                    <p data-bind="text: DisplayMessage()"></p>\r\n                    <p data-bind="text: TimeElapsed()" class="announce-date"></p>\r\n                </div>\r\n            </div>\r\n\r\n        </div>\r\n\r\n        <div class="div-fader"></div>\r\n\r\n    </div>\r\n\r\n</div>\r\n';});


define('text!views/join-house.html',[],function () { return '<div class="page-header">\r\n    <h2 data-bind="text: pageHeader"></h2>\r\n</div>\r\n\r\n<button class="btn btn-primary" data-bind="click: logoutClicked">Logout</button>\r\n\r\n<div class="row col-md-12">\r\n    <p>Thanks for registering, lets get started setting up your house...</p>\r\n</div>\r\n\r\n<div data-bind="if: houseJoinRequest">\r\n    <div class="well col-md-5 module-panel">\r\n\r\n        <h3 class="panel-header">Pending Join Requests</h3>\r\n\r\n        <p>\r\n            The following requests are awaiting review from a member of the house.\r\n        </p>\r\n\r\n        <table class="table">\r\n            <thead>\r\n                <tr>\r\n                    <td></td>\r\n                    <td>House</td>\r\n                    <td>Code</td>\r\n                    <td></td>\r\n                </tr>\r\n            </thead>\r\n            <tbody>\r\n                <tr>\r\n                    <td>\r\n                        <span id="joinRequestHouseIcon" class="glyphicon glyphicon-home"></span>\r\n                    </td>\r\n                    <td>\r\n                        <span id="joinRequestHouseName" data-bind="text: houseJoinRequest().House().HouseName()"></span>\r\n                    </td>\r\n                    <td>\r\n                        <span id="joinRequestHouseCode" data-bind="text: houseJoinRequest().House().HouseCode()"></span>\r\n                    </td>\r\n                    <td>\r\n                        <button data-bind="click: cancelRequestClicked" class="btn btn-danger btn-xs">\r\n                            <span id="joinRequestCancelIcon" class="glyphicon glyphicon-remove"></span>\r\n                        </button>\r\n                    </td>\r\n                </tr>\r\n            </tbody>\r\n        </table>\r\n\r\n    </div>\r\n</div>\r\n\r\n<div data-bind="if: !houseJoinRequest()">\r\n    <div class="well col-md-5 module-panel">\r\n\r\n        <h3 class="panel-header">Join an existing house</h3>\r\n\r\n        <form class="form-horizontal" role="form">\r\n            <div class="form-group">\r\n                <label for="inputJoinHouseCode" class="col-sm-3 control-label">House Code</label>\r\n                <div class="col-sm-4">\r\n                    <input data-bind="value: joinHouseCode" class="form-control" id="inputJoinHouseCode" placeholder="E.g. 51KER">\r\n                </div>\r\n            </div>\r\n\r\n            <div class="form-group">\r\n                <div class="col-sm-offset-3 col-sm-10">\r\n                    <button data-bind="click: joinExistingHouseClicked" type="submit" class="btn btn-primary">Join</button>\r\n                </div>\r\n            </div>\r\n        </form>\r\n\r\n    </div>\r\n</div>\r\n\r\n<div class="well col-md-5 col-md-offset-1 module-panel">\r\n\r\n    <h3 class="panel-header">Create a new house</h3>\r\n\r\n    <form class="form-horizontal" role="form">\r\n\r\n        <div class="form-group">\r\n            <label for="inputCreateHouseName" class="col-sm-4 control-label">House Name</label>\r\n            <div class="col-sm-8">\r\n                <input data-bind="value: createHouseName" class="form-control" id="inputCreateHouseName" placeholder="E.g. 51 King Edwards Road">\r\n            </div>\r\n        </div>\r\n\r\n        <div class="form-group">\r\n            <label for="inputCreateHouseCode" class="col-sm-4 control-label">House Code</label>\r\n            <div class="col-sm-8">\r\n                <input data-bind="value: createHouseCode" class="form-control" id="inputCreateHouseCode" placeholder="E.g. 51KER">\r\n            </div>\r\n        </div>\r\n\r\n        <div class="form-group">\r\n            <div class="col-sm-offset-4 col-sm-10">\r\n                <button data-bind="click: createNewHouseClicked" type="submit" class="btn btn-success">Create</button>\r\n            </div>\r\n        </div>\r\n    </form>\r\n\r\n</div>\r\n';});


define('text!views/login.html',[],function () { return '<div class="page-header">\r\n    <h2>Welcome back!</h2>\r\n</div>\r\n\r\n<div id="login-panel" class="well col-md-5 module-panel">\r\n\r\n    <button id="fb-login-btn" class="btn"></button>\r\n\r\n    <h3 class="panel-header">Or use a registered account</h3>\r\n\r\n    <table class="panel-table">\r\n        <tbody>\r\n            <tr>\r\n                <td><label>Email:</label></td>\r\n                <td><input data-bind="value: loginEmail" type="text" class="form-control"></td>\r\n            </tr>\r\n            <tr>\r\n                <td><label>Password:</label></td>\r\n                <td><input data-bind="value: loginPassword" type="password" class="form-control"></td>\r\n            </tr>\r\n            <tr>\r\n                <td></td>\r\n                <td><button data-bind="click: loginClicked" class="btn btn-primary">Login</button></td>\r\n            </tr>\r\n        </tbody>\r\n    </table>\r\n</div>\r\n\r\n<div class="col-md-1"></div>\r\n\r\n<div id="register-panel" class="well col-md-5 module-panel">\r\n    <h3 class="panel-header">Register an account</h3>\r\n\r\n    <table class="panel-table">\r\n        <tbody>\r\n            <tr>\r\n                <td>\r\n                    <label>Full Name:</label></td>\r\n                <td>\r\n                    <input data-bind="value: registerFullName" type="text" class="form-control"></td>\r\n            </tr>\r\n            <tr>\r\n                <td>\r\n                    <label>Email:</label></td>\r\n                <td>\r\n                    <input data-bind="value: registerEmail" type="text" class="form-control"></td>\r\n            </tr>\r\n            <tr>\r\n                <td>\r\n                    <label>Password:</label></td>\r\n                <td>\r\n                    <input data-bind="value: registerPassword1" type="password" class="form-control"></td>\r\n            </tr>\r\n            <tr>\r\n                <td>\r\n                    <label>Retype Password:</label></td>\r\n                <td>\r\n                    <input data-bind="value: registerPassword2" type="password" class="form-control"></td>\r\n            </tr>\r\n\r\n            <tr>\r\n                <td></td>\r\n                <td>\r\n                    <button data-bind="click: registerClicked" class="btn btn-primary">Register</button></td>\r\n            </tr>\r\n        </tbody>\r\n    </table>\r\n</div>\r\n';});


define('text!views/messages.html',[],function () { return '<div class="page-header">\r\n    <h2>Messages</h2>\r\n</div>\r\n\r\n<div class="row">\r\n\r\n    <div class="col-md-4">\r\n        <div id="conversation-buttons" class="well">\r\n\r\n            <button data-bind="click: newConvoClicked" class="btn btn-primary">\r\n                <span class="glyphicon glyphicon-plus"></span>\r\n                <span>New Conversation</span>\r\n            </button>\r\n\r\n            <!-- ko foreach: conversationsList -->\r\n            <button class="btn btn-default" data-bind="click: $root.conversationClicked, css: { active: $data == $root.activeConversation() }">\r\n                <strong data-bind="text: RecipientsString()"></strong> \r\n                <!-- ko if: Messages().length > 0 -->\r\n                <span class="convo-btn" data-bind="text: Messages()[Messages().length-1].Content()"></span>\r\n                <!-- /ko -->\r\n            </button>\r\n            <!-- /ko -->\r\n        </div>\r\n    </div>\r\n\r\n    <div class="col-md-1"></div>\r\n\r\n    <div id="conversation-panel" class="col-md-6 module-panel">\r\n        <div class="well">\r\n\r\n            <!-- ko if: !activeConversation()-->\r\n            <div id="empty-convo-msg">\r\n                \r\n                <span>No conversations are being viewed. <BR />Select a conversation to view, or create a new one.</span>\r\n            </div>\r\n            <!-- /ko -->\r\n\r\n            <!-- ko if: activeConversation -->\r\n            <div id="conv-recip-panel">\r\n\r\n                <div class="btn-group">\r\n                    <button type="button" class="btn btn-default dropdown-toggle" data-toggle="dropdown">\r\n                        Add Recipient <span class="caret"></span>\r\n                    </button>\r\n                    <ul data-bind="foreach: tenantsList()" class="dropdown-menu" role="menu">\r\n                        <li><a data-bind="text: FullName, click: $root.recipientAdded"></a></li>\r\n                    </ul>\r\n                </div>\r\n\r\n                <ul data-bind="foreach: activeConversation().ConversationUsers()" class="pager">\r\n                    <li><a href="#">\r\n                        <img class="conversation-recip img-circle" data-bind="attr: { src: User().DisplayPictureFilePath }">\r\n                        <span data-bind="text: User().FullName"></span>\r\n                        </a>\r\n                    </li>                    \r\n                </ul>\r\n            </div>\r\n\r\n            <div id="convo-panel" class="panel panel-default">\r\n                <div id="convo-scroller" data-bind="foreach: activeConversation().Messages()" class="panel-body">\r\n                    \r\n                    <p><strong data-bind="text: UserSent().FirstName"></strong>: <span data-bind="text: Content"></span></p>\r\n                   \r\n                </div>\r\n            </div>\r\n\r\n            <div class="input-group">\r\n                <input id="message-box" data-bind="value: composingMessage, valueUpdate:\'afterkeydown\'" type="text" class="form-control" placeholder="Type your message here...">\r\n                <span class="input-group-btn">\r\n                    <button data-bind="click: messageSent" id="send-announce-btn" type="button" class="btn btn-success">\r\n                        <span class="glyphicon glyphicon-plus"></span>\r\n                    </button>\r\n                </span>\r\n            </div>\r\n            <!-- /ko -->\r\n        </div>\r\n    </div>\r\n\r\n</div>\r\n';});


define('text!views/nav.html',[],function () { return '<div class="nav-header">\r\n    <span id="nav-logo" class="glyphicon glyphicon-home"></span>\r\n    <div id="header-text">\r\n        <h4>Tenant<br /> Organiser</h4>\r\n        <p>51 King Edwards Road</p>\r\n    </div>\r\n</div>\r\n\r\n<hr class="nav-seperator">\r\n\r\n<div id="account-panel">\r\n    <img id="profile-pic" class="img-circle" data-bind="attr: { src: sessionUser().DisplayPictureFilePath() }">\r\n    <span id="user-fullname" data-bind="text: sessionUser().FullName()"></span>\r\n\r\n    <ul id="icon-panel">\r\n        <li><a data-bind="attr: { href: messagesTag }"><span class="glyphicon glyphicon-envelope"></span></a></li>\r\n        <li><a data-bind="attr: { href: tenantsTag }"><span class="glyphicon glyphicon-user"></span></a></li>\r\n        <li><a data-bind="attr: { href: settingsTag }"><span class="glyphicon glyphicon-cog"></span></a></li>\r\n        <li><a data-bind="click: logoutClicked" href="#"><span class="glyphicon glyphicon-log-out"></span></a></li>\r\n    </ul>\r\n</div>\r\n\r\n<ul id="nav-list">\r\n    <li><a data-bind="attr: { href: homeTag }"><span class="glyphicon glyphicon-home"></span>Home</a></li>\r\n    <li><a data-bind="attr: { href: billsTag }"><span class="glyphicon glyphicon-gbp"></span>Bills</a></li>\r\n    <li><a data-bind="attr: { href: tasksTag }"><span class="glyphicon glyphicon-list"></span>Tasks</a></li>\r\n    <li><a data-bind="attr: { href: wishListTag }"><span class="glyphicon glyphicon-heart"></span>Wish List</a></li>\r\n</ul>\r\n\r\n<hr class="nav-seperator">\r\n\r\n<footer>\r\n    <span>&copy; Copyright 2013<br />\r\n        Adam Barrell<br /> All Rights Reserved</span>\r\n</footer>';});


